"Change Set:		8043Collections-nice.171Collections-nice.171:deprecated #fasterKeys(should be removed soon)"!!Dictionary methodsFor: 'accessing' stamp: 'nice 10/21/2009 01:50'!fasterKeys	"Contrary to old version of #keys, this method returned an Array rather than a Set.	This was faster because no lookup: was performed.	But now, #keys also return an Array, so don't use #fasterKeys anymore."		self deprecated: 'use #keys'.	^self keys.! !WeakRegistry removeSelector: #fasterKeys!KeyedSet removeSelector: #fasterKeys!